import { Tabs } from 'flowbite-react';
import React from 'react';
import { LuEdit, LuHeart } from "react-icons/lu";
import { IoImageOutline } from "react-icons/io5";
import "./style.scss";
import { Link, NavLink } from 'react-router-dom';
import UserPosts from '../../pages/User/posts';



const TabProfile = (props) => {
    return (
        <Tabs.Group style='underline'>
            <Tabs.Item
                active
                icon={LuEdit}
                title={<NavLink to="/:slugUser/"> Bài viết</NavLink>}>
                {props.component}
            </Tabs.Item>

            <Tabs.Item
                icon={LuHeart}
                title={<NavLink to="/:slugUser/favourites">Yêu thích</NavLink>}>
                {props.component}
            </Tabs.Item>

            <Tabs.Item
                icon={IoImageOutline}
                title={<NavLink to="/:slugUser/photos">Hình ảnh</NavLink>}>
                {props.component}
            </Tabs.Item>
        </Tabs.Group >
    );
};

export default TabProfile;
